import React from 'react';

const CenteredBox = () => {
  const boxStyle = {
    width: '300px', // Adjust the width as per your requirement
    height: '200px', // Adjust the height as per your requirement
    margin: 'auto',
    marginTop: '50px', // Adjust the top margin as per your requirement
    border: '1px solid #ccc',
    borderRadius: '5px',
    textAlign: 'center',
    padding: '20px',
    boxSizing: 'border-box',
  };

  return (
    <div style={boxStyle}>
      <h1>Coin Toss</h1>
      <p></p>
    </div>
  );
};

export default CenteredBox;
